RECORDS["_224"] = new MedievalDocuments("_224", 1655, "Constantin Șerban voievod scutește slobozia mănăstirii Bistrița, satul Costeștii din j. Vâlcea, de bir, de dijmă și alte dări, ca și ceilalți domni înaintea sa.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "2", "1655 (7164);septembrie 18");
