RECORDS["_226"] = new MedievalDocuments("_226", 1655, "Constantin Șerban voievod întărește satului Săoșul al mănăstirii Bistrița scutirea acordată de Matei Basarab voievod de lucrul la Ocnele Mari, numai să-si plătească birul țărănesc și să asculte de egumenul mănăstirii.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "2", "1655 (7164);septembrie 19");
RECORDS["_227"] = new MedievalDocuments("_227", 1655, "Papa, paharnic, fiul lui Buzinca mare comis, <din Cepturi, j. Saac>, vinde lui Tudoran iuzbașa 11 stânjeni de moșie din sat pentru un cal vânăt, rotat, care face 34 de ughi și jumătate.", "Română", "Hârtie", "Original", "Constantin Șerban", "Papa", null, "Țara Românească", "2", "1655 (7164);septembrie 20");
RECORDS["_228"] = new MedievalDocuments("_228", 1655, "Constantin Șerban voievod poruncește celor doisprezece boieri hotarnici luați de Episcopia de Buzău, Colțea mare pitar și satul Văleni, să aleagă moșia lui Ivăniș vornic, partea Episcopiei și a lui Colțea, dinspre satul Văleni.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "2", "1655 (7164);septembrie 20");
RECORDS["_229"] = new MedievalDocuments("_229", 1655, "Constantin Șerban voievod înștiințează satul Văleni, j. Sac, de ancheta pe care cei doisprezece boieri hotarnici luați de Episcopia de Buzău, o vor desfășura la ei în sat.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "2", "1655 (7164);septembrie 20");
RECORDS["_230"] = new MedievalDocuments("_230", 1655, "Constantin Șerban voievod întărește părintelui Serafim, episcopul Buzăului, stăpânirea unei țigănci, în vreme ce Andrei și fratele său, Nicolae, dărăbanți din Târgoviște, rămân de lege și nu mai au voie să se mai amestece.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "2", "1655 (7164);septembrie 21");
RECORDS["_231"] = new MedievalDocuments("_231", 1655, "Constantin Șerban voievod întărește părintelui Gavriil de la mănăstirea Potocul, satul Vâlsănești, j. Romanați.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "2", "1655 (7164);septembrie 21");
RECORDS["_232"] = new MedievalDocuments("_232", 1655, "Gheorghe mare vornic, cercetând pricina dintre Constantin căpitan și Leca căpitan pentru satul Rădăcinești <j. Argeș>, hotărăște ca Leca căpitan să-l stăpânească, fiind primul cumpărător.", "Română", "Hârtie", "Original", "Constantin Șerban", "Gheorghe", null, "Țara Românească", "2", "1655 (7164);septembrie 22");
