RECORDS["_275"] = new MedievalDocuments("_275", 1655, "Cârstea Puricel din Pietroșița și fiul său, Stan, dau popii Radul din Șerbănești <j. Dâmbovița>, două locuri în Zăpodie și în Valea Buciumilor, pentru 5 sărăcuste.", "Română", "Hârtie", "Original", "Constantin Șerban", "Cârstea Puricel", null, "Țara Românească", "2", "1655 (7164);noiembrie 9");
RECORDS["_276"] = new MedievalDocuments("_276", 1655, "Radu logofăt ia de la Vâlcul logofăt 11 ughi ca să plătească birul fratelui său Stefan, pentru care ii dă moșia Bărbulești <j. Dâmbovița>, urmând să primească și restul de bani.", "Română", "Hârtie", "Original", "Constantin Șerban", "Radul", null, "Țara Românească", "2", "1655 (7164);noiembrie 10");
RECORDS["_277"] = new MedievalDocuments("_277", 1655, "Constantin Șerban întărește mănăstirii Dealul venitul ocinei Călugărenii după mai multe judecăți cu orășenii din Târgoviște.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "5176", "Țara Românească", "2", "1655 (7164);noiembrie 10");
RECORDS["_278"] = new MedievalDocuments("_278", 1655, "Dumitru din Belitori, j. Teleorman, împreună cu soția și fiii vinde lui Badea vătaf o funie și jumătate de moșie în sat, fără rumâni, cu 15 ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Dumitru împreună cu soția și fiii lui", null, "Țara Românească", "2", "1655 (7164);noiembrie 11");
RECORDS["_279"] = new MedievalDocuments("_279", 1655, "Ivan și fiul său, Nicola, din Berceștii de la Răstoacă, j. Argeș, se vând rumâni lui Pană postelnic, cu 20 de ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Ivan și fiul său, Nicola", null, "Țara Românească", "2", "1655 (7164);noiembrie 11");
RECORDS["_280"] = new MedievalDocuments("_280", 1655, "Oprea logofăt din Budișteni <j. Muscel>, face schimb de locuri de vii la Hoțul, cu Stanciul logofăt din Budișteni.", "Română", "Hârtie", "Original", "Constantin Șerban", "Oprea", null, "Țara Românească", "2", "1655 (7164);noiembrie 11");
RECORDS["_281"] = new MedievalDocuments("_281", 1655, "Dumitru din Belitori, j. Teleorman, împreună cu soția sa, vând lui Badea vătaf o funie și jumătate de moșie în sat, fără rumâni, cu 80 de ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Dumitru împreună cu soția și fiii lui", null, "Țara Românească", "2", "1655 (7164);noiembrie 12");
RECORDS["_282"] = new MedievalDocuments("_282", 1655, "Mateiu paharnic și fratele său, Pârvul postelnic, fiii lui Vucina paharnic, vând lui Stănislav logofăt din Căcășani, ocină în Găleșăști <j. Argeș>, 150 de stânjeni, cu 76 de ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Mateiu și fratele său, Pârvul", null, "Țara Românească", "2", "1655 (7164);noiembrie 13");
RECORDS["_283"] = new MedievalDocuments("_283", 1655, "Duță și soția sa vând lui Seman și fiului său, Stan, 30 de stânjeni de ocină în Oltenei, <j. Buzău>, cu 4 ughi și jumătate și 5 costande.", "Română", "Hârtie", "Original", "Constantin Șerban", "Duță și soția sa", null, "Țara Românească", "2", "1655 (7164);noiembrie 15");
RECORDS["_284"] = new MedievalDocuments("_284", 1655, "Caloin vinde lui Stoica, iuzbașa din Berciugovu <j. Ilfov>, și fratelui său Micu, o vie cu 12 ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Caloin", null, "Țara Românească", "2", "1655 (7164);noiembrie 16");
RECORDS["_285"] = new MedievalDocuments("_285", 1655, "Iane din Die cu fiii săi, Nica și Hiștov, se vând rumâni lui Pană postelnic, cu 36 de ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Iane cu fiii săi, Nica și Hiștov", null, "Țara Românească", "2", "1655 (7164);noiembrie 16");
RECORDS["_286"] = new MedievalDocuments("_286", 1655, "Iane, fratele lui, Ghiurghia și alții împrumută de la Pană postelnic 240 de ughi cu termen peste 2 luni.", "Română", "Hârtie", "Original", "Constantin Șerban", "Iane, fratele lui, Ghiurghia și alții", null, "Țara Românească", "2", "1655 (7164);noiembrie 16");
RECORDS["_287"] = new MedievalDocuments("_287", 1655, "Radu, fiul lui Voico din Mircești, vinde lui Ivan căpitan partea sa de moșie din Negovanul <j. Vlașca>, cu 12 ughi, bani gata.", "Română", "Hârtie", "Original", "Constantin Șerban", "Radu", null, "Țara Românească", "2", "1655 (7164);noiembrie 18");
RECORDS["_288"] = new MedievalDocuments("_288", 1655, "Șase boieri aleg și hotărăsc moșia și viile de la Valea Teancului, moșie ce se cheamă Jegălească <la Vernești, j. Buzău>, învoindu-se astfel la această împărțeală Bratul Săcuianul cu ceata lui și Stan Vârjoghie cu ceata lui.", "Română", "Hârtie", "Original", "Constantin Șerban", "Șase boieri", null, "Țara Românească", "2", "1655 (7164);noiembrie 19");
RECORDS["_289"] = new MedievalDocuments("_289", 1655, "Papa paharnic <fiul lui Buzinca comis> vinde lui Vlad și fratelui său, Chisar, moșie la Cepturi <j. Sac>, cu câte 3 ughi stânjenul.", "Română", "Hârtie", "Original", "Constantin Șerban", "Papa", null, "Țara Românească", "2", "1655 (7164);noiembrie 20");
RECORDS["_290"] = new MedievalDocuments("_290", 1655, "Constantin Șerban voievod întărește mănăstirii Bărbătești moșii la Priboi și Doicești, j. Dâmbovița.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "5176", "Țara Românească", "2", "1655 (7164);noiembrie 20");
RECORDS["_291"] = new MedievalDocuments("_291", 1655, "Dragomir, fiul lui Bunea din Gomoești, și Duma, vărul său, vând lui Moise căpitan de roșii 24 de stânjeni de ocină în Pârscoveni <j. Buzău>, cu 7 ughi și 4 costande, bani gata.", "Română", "Hârtie", "Original", "Constantin Șerban", "Dragomir și Duma, vărul său", null, "Țara Românească", "2", "1655 (7164);noiembrie 22");
RECORDS["_292"] = new MedievalDocuments("_292", 1655, "Jitco, Pătru, Dumitru și Ispan din Dobroteni adeveresc lui Varlaam, egumenul mănăstirii Căldărușani, că au luat de la acesta 12 ughi, iar pentru dobânda banilor să lucreze 4 pogoane de vie din sat.", "Română", "Hârtie", "Original", "Constantin Șerban", "Jitco, Pătru, Dumitru și Ispan", null, "Țara Românească", "2", "1655 (7164);noiembrie 23");
RECORDS["_293"] = new MedievalDocuments("_293", 1655, "Constantin Șerban voievod poruncește megieșilor birnici de la Brătienii de Jos <j. Argeș> să-și plătească birul pe care mai înainte l-a plătit Tudoran paharnic.", null, null, "Rezumat", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "2", "1655 (7164);noiembrie 24");
RECORDS["_294"] = new MedievalDocuments("_294", 1655, "Douăzeci și patru de boieri luați de Radul, fiul lui Șerban vistier și de egumenul Ignatie, hotărăsc moșiile lor din Bărăganul și Întorsura <j. Ialomița>.", "Română", null, "Copie", "Constantin Șerban", "Douăzeci și patru de boieri", null, "Țara Românească", "2", "1655 (7164);noiembrie 25");
RECORDS["_295"] = new MedievalDocuments("_295", 1655, "Constantin Șerban voievod întărește lui Evstratie și soției lui, Elina, stăpânirea satului Slatina <j. Olt>.", null, null, null, "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "2", "1655 (7164);noiembrie 26");
RECORDS["_296"] = new MedievalDocuments("_296", 1655, "Cârste, fiul lui Ignat din Golești, <j. Muscel> vinde lui Vasilie logofăt 3 pogoane de vie, cu pimniță, pentru 1 000 bani gata.", "Română", "Hârtie", "Original", "Constantin Șerban", "Cârste", null, "Țara Românească", "2", "1655 (7164);noiembrie 27");
RECORDS["_297"] = new MedievalDocuments("_297", 1655, "Megieșii din Urdești <j. Dâmbovița> vând vătafului de paici, Radu din Urdești, și lui Vlad, fiul lui Radul Brânză, partea de moșie a Chimei din sat, cu 5 000 de aspri gata.", "Română", "Hârtie", "Original", "Constantin Șerban", "Megieșii din Urdești", null, "Țara Românească", "2", "1655 (7164);noiembrie 30");
RECORDS["_298"] = new MedievalDocuments("_298", 1655, "Dan, fiul lui Tatul slujer, vinde lui Bunea vistier, partea sa de moșie din Grădiște <j. Muscel și Pădureț>, jumătate de sat, cu două case de rumâni, cu 150 de ughi, bani gata.", "Română", "Hârtie", "Original", "Constantin Șerban", "Dan", null, "Țara Românească", "2", "1655 (7164);decembrie 1");
RECORDS["_299"] = new MedievalDocuments("_299", 1655, "Vădislav dăruiește egumenului Ioanichie de la mănăstirea Jitianul un Țigan, Calin, pe care l-a cumpărat de la jupâneasa Neaga cu 13 ughi.", "Română", null, "Copie", "Constantin Șerban", "Vădislav", null, "Țara Românească", "2", "1655 (7164);decembrie 3");
RECORDS["_300"] = new MedievalDocuments("_300", 1655, "Mitropolitul Țării Romanești, Stefan, confirmă dania de vinărici de la Greaca <j. Ilfov> făcută de domnii Țării Leon Tomșa, Matei Basarab și Constantin Șerban mănăstirii Sărindar.", null, "Microfilm", "Original", "Constantin Șerban", "Mitropolitul Țării Romanești, Stefan", null, "Țara Românească", "2", "1655 (7164);decembrie 4");
RECORDS["_301"] = new MedievalDocuments("_301", 1655, "Fătul, fiul lui Voico din Brătianii de Jos, j. Argeș, adeverește lui Tudoran paharnic din Aninosa că i-a zălogit partea lui de moșie din sat pentru un împrumut de 1 000 de aspri.", "Română", null, "Copie", "Constantin Șerban", "Fătul", null, "Țara Românească", "2", "1655 (7164);decembrie 7");
RECORDS["_302"] = new MedievalDocuments("_302", 1655, "Fătul, fiul lui Voico, și Stanciul, rumânul mănăstirii Brădet, vând lui Tudoran paharnic din Aninoasa delnița lui Năvrapu din Brătianii de Jos <j. Argeș>, cu 15 ughi, bani gata, pentru partea acestuia de bir pe care a plătit-o Tudoran.", "Română", null, "Copie", "Constantin Șerban", "Fătul și Stanciul", null, "Țara Românească", "2", "1655 (7164);decembrie 8");
RECORDS["_303"] = new MedievalDocuments("_303", 1655, "Bratul, fiul lui Badea din Brătianii de Jos, j. Argeș, vinde lui Tudoran paharnic din Aninoasa, partea lui din sat, 10 locuri, moșie stearpă, fără rumâni, cu 1 900 aspri, bani gata.", "Română", null, "Copie", "Constantin Șerban", "Bratul", null, "Țara Românească", "2", "1655 (7164);decembrie 10");
RECORDS["_304"] = new MedievalDocuments("_304", 1655, "Bratul, fiul lui Badea din Brătianii de Jos, j. Argeș, vinde lui Tudoran paharnic din Aninoasa, partea lui din sat, moșie stearpă, fără rumâni, cu 14 ughi și jumătate, bani gata.", "Română", null, "Copie", "Constantin Șerban", "Bratul", null, "Țara Românească", "2", "1655 (7164);decembrie 10");
RECORDS["_305"] = new MedievalDocuments("_305", 1655, "Balotă din Gârbovii de Jos vinde lui Gheorghe, mare vornic din Băleni, 80 de stânjeni de ocină în Schimbați <j. Gorj> cu 24 de ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Balotă", null, "Țara Românească", "2", "1655 (7164);decembrie 11");
RECORDS["_306"] = new MedievalDocuments("_306", 1655, "Constantin Șerban voievod întărește lui Mihaiu logofăt și jupânesei sale, Stanca, fiica lui Radul Potlogeanul din Băleni, j. Dâmbovița, ocini cumpărate și moștenite.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "5176", "Țara Românească", "2", "1655 (7164);decembrie 12");
RECORDS["_307"] = new MedievalDocuments("_307", 1655, "Chira iuzbașa vinde lui Dobre logofăt, fiul lui Tatomir, jumătate de pogon de vie și o jumătate de stânjen de ocină în dealul Moceștilor <j. Buzău> pentru 6 ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Chira", null, "Țara Românească", "2", "1655 (7164);decembrie 14");
RECORDS["_308"] = new MedievalDocuments("_308", 1655, "Calea și Stanca, surorile Ilinei, cumnatele lui Stroe Leurdeanu mare logofăt, se învoiesc cu acesta pentru averea rămasă de la sora lor, moartă la Brașov, unde s-a refugiat în timpul răscoalei seimenilor.", "Română", "Hârtie", "Original", "Constantin Șerban", "Calea și Stanca", null, "Țara Românească", "2", "1655 (7164);decembrie 15");
RECORDS["_309"] = new MedievalDocuments("_309", 1655, "Oprea, soția lui Barcă călăraș, împreună cu fiii ei, vinde lui Petriman logofăt o curătură în Văleni <j. Dâmbovița>, cu 5 taleri.", "Română", "Hârtie", "Original", "Constantin Șerban", "Oprea împreună cu copiii ei", null, "Țara Românească", "2", "1655 (7164);decembrie 16");
RECORDS["_310"] = new MedievalDocuments("_310", 1655, "Dumitru, fiul lui Ivan Cortofleș din Pitești, împreună cu frații lui se tocmesc cu egumenul Luca de la mănăstirea Câmpulung pentru două delnițe în dealul Piteștilor.", "Română", "Hârtie", "Original", "Constantin Șerban", "Dumitru împreună cu frații lui", null, "Țara Românească", "2", "1655 (7164);decembrie 20");
RECORDS["_311"] = new MedievalDocuments("_311", 1655, "Constantin Șerban voievod întărește jupânesei Conda, soția lui Avram roșul din Brănești, o vie în dealul Piteștilor.", null, null, "Copie", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "2", "1655 (7164);decembrie 20");
RECORDS["_312"] = new MedievalDocuments("_312", 1655, "Badea din Suslănești vinde lui Dragomir al lui Gășa din Dragoslavele un loc la Sturu <j. Muscel> și mai multe livezi, cu 11 ughi.", "Română", null, "Rezumat", "Constantin Șerban", "Badea", null, "Țara Românească", "2", "1655 (7164);decembrie 20");
RECORDS["_313"] = new MedievalDocuments("_313", 1655, "Dumitru, fiul lui Mușat din Mușcel, și Bobe din Mușcel vând lui Gherghina din Vaideel partea lor de moșie din acest sat <j. Sac>, cu 500 bani gata, respectiv 600 de bani gata.", "Română", null, "Copie", "Constantin Șerban", "Dumitru", null, "Țara Românească", "2", "1655 (7164);decembrie 21");
RECORDS["_314"] = new MedievalDocuments("_314", 1655, "Calciul și cumnata sa, Anca, adeveresc că Toader și Grozea au făcut mai multe cumpărături în Berești, j. Argeș, iar Badea a pus zălog la Tudor moșie în Cacova.", "Română", null, "Copie", "Constantin Șerban", "Calciul și cumnata sa, Anca", null, "Țara Românească", "2", "1655 (7164);decembrie 23");
RECORDS["_315"] = new MedievalDocuments("_315", 1655, "Constantin Șerban voievod întărește mănăstirii Codmeana și egumenului Silvestru, moșiile și rumânii din satele Bărbăteștii, Stănceștii, Carcaleții, Purcăreanii, Mogoșeștii și Ciocăneștii <j. Muscel>, dăruite de jupân Mircea.", "Română", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "5176", "Țara Românească", "2", "1655 (7164);decembrie 25");
RECORDS["_316"] = new MedievalDocuments("_316", 1655, "Constantin Șerban voievod întărește lui Bunea fost mare vistier satul Fundenii, pe Colentina, j. Ilfov, cu mori dar fără vecini, cumpărat de la Papa paharnic cu 150 galbeni, satul Grădiștea de Jos, j. Muscel, fără vecini și jumătate din satul Nănești, j. Vâlcea.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "5176", "Țara Românească", "2", "1655 (7164);decembrie 26");
RECORDS["_317"] = new MedievalDocuments("_317", 1655, "Radu, fiul lui Stoica din Bărbuleț, j. Dâmbovița, vinde lui Radu Crețulescul logofăt o livadă de fan de la Piatra Iaderii, cu 4 ughi, bani gata.", "Română", "Hârtie", "Original", "Constantin Șerban", "Radu", null, "Țara Românească", "2", "1655 (7164);decembrie 28");
RECORDS["_318"] = new MedievalDocuments("_318", 1655, "Stan, fiul meșterului Stan, și Nedelcu, fiul lui Ianu, vând partea lor de moșie din Urdești <j. Dâmbovița>, cu 10 ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Stan și Nedelcu", null, "Țara Românească", "2", "1655 (7164);decembrie 28");
RECORDS["_319"] = new MedievalDocuments("_319", 1655, "Bratul, fiul Calei din Cacaleți, vinde lui Moise căpitan de roșii 9 stânjeni de ocină în Pârscoveni <j. Buzău>, cu 500 de bani și 4 costande, bani gata.", "Română", "Hârtie", "Original", "Constantin Șerban", "Bratul", null, "Țara Românească", "2", "1655 (7164);decembrie 30");
RECORDS["_320"] = new MedievalDocuments("_320", 1655, "Popa [Ion] și Stan dau zapis lui Drăghici postelnicul, înțelegându-se în privința moșiilor și a zestrei fetei lui Stoica.", "Română", null, "Original", "Constantin Șerban", "Popa [Ion], Stan și Dumitru", null, "Țara Românească", "2", "1655 (7164);decembrie 30");
RECORDS["_321"] = new MedievalDocuments("_321", 1655, "Mihăilă, fiul popii Șerban din Izvorani, se tocmește cu Luca, egumenul mănăstirii Câmpulung, să mai primească din partea mănăstirii 2 boi și o vacă pentru o delniță din dealul Izvoranilor <j. Muscel>, „luată în silă” în timpul lui Matei Basarab voievod.", "Română", "Hârtie", "Original", "Constantin Șerban", "Mihăilă", null, "Țara Românească", "2", "1655 (7164);decembrie 30");
RECORDS["_322"] = new MedievalDocuments("_322", 1654, "Preda, nepotul lui Stanciul logofăt din Cârstienești vinde lui Stoica Băilescu din Boișoara și fratelui acestuia, Ion, delnița lui Stoica al lui Scundilă și a lui Lancie din Bumbuiești, j. Argeș, cu 16 ughi și jumătate, pentru birul pe care l-a plătit unchiul său la vremea haraciului.", "Română", "Hârtie", "Original", "Matei Basarab", "Preda, nepotul Stanciului logofăt", null, "Țara Românească", "3", "<Circa 1654>");
RECORDS["_323"] = new MedievalDocuments("_323", 1654, "Șase boieri luați cu răvașe domnești de către Darie al lui Neguțu din Suslănești și Oprea, fiul Oprei vătaf, aleg moșiile și rumânii din Nămăiești și Suslănești, j. Argeș, după cărțile lor vechi.", "Română", "Hârtie", "Original", "Matei Basarab", "Șase boieri", null, "Țara Românească", "3", "1654 (7162);ianuarie");
RECORDS["_324"] = new MedievalDocuments("_324", 1654, "Mitropolitul Ignatie al Ungrovlahiei hotărăște ca mănăstirea Mislea să fie lăsată în pace de către slugile domnești, ale Mitropoliei și de către protopopi.", "Română", null, "Copie", "Matei Basarab", "Mitropolitul Ignatie", null, "Țara Românească", "3", "1654 (7162);ianuarie 1");
RECORDS["_325"] = new MedievalDocuments("_325", 1654, "Radu, fiul lui Colțea din Șchiai, vinde vornicului Colțea, partea lui de moșie de 35 stânjeni, la Costeni, j. Romanați, și un rumân cu feciorii lui, pentru 30 ughi.", "Română", "Hârtie", "Original", "Matei Basarab", "Radul snă Colții", null, "Țara Românească", "3", "1654 (7162);ianuarie 1");
RECORDS["_326"] = new MedievalDocuments("_326", 1654, "Preda slugerul se înfrățește cu Radu Mihalcea Cândescu mare comis, dăruindu-i partea lui de ocină din Mătești, de 150 stânjeni, primind în schimb 100 ughi.", "Română", "Hârtie", "Original", "Matei Basarab", "Preda slugerul", "5176", "Țara Românească", "3", "1654 (7162);ianuarie 2");
