RECORDS["_381"] = new MedievalDocuments("_381", 1654, "Matei Basarab voievod întărește lui Bunea Grădișteanu mare vistier și fiicei sale, Anca, averea ce-i revine după moartea soțului, Ianache spătar, fiul lui Socol Cornățeanu și a socrului ei, a patra parte din moșiile cuvenite acestuia, în contul zestrei.", "Română", "Hârtie", "Original", "Matei Basarab", "Matei Basarab", "5176", "Țara Românească", "3", "1654 (7162);martie 10");
RECORDS["_382"] = new MedievalDocuments("_382", 1654, "Oprea logofăt și jupâneasa lui, Maria, vând lui Stanciu logofăt moșie de la Dobroieștii de Jos, <j. Muscel>, cu 75 de ughi.", "Română", "Hârtie", "Original", "Matei Basarab", "Oprea logofăt și jupâneasa lui, Maria", null, "Țara Românească", "3", "1654 (7162);martie 12");
RECORDS["_383"] = new MedievalDocuments("_383", 1654, "Mai mulți megiași din Gârbovi se împrumută de la Nicola pârcălabul din Glogova de diferite sume de bani, angajându-se să-i lucreze 20 zile drept dobândă.", "Română", "Hârtie", "Original", "Matei Basarab", "Megiașii din Gârbovi", null, "Țara Românească", "3", "1654 (7162);martie 15");
RECORDS["_384"] = new MedievalDocuments("_384", 1654, "Matei Basarab voievod întărește lui Vlad logofăt de vistierie, fiul lui Preda Bârsescu clucer, stăpânirea asupra mai multor sate și ocini din moștenirea boierilor Drăgoiești, care au fost cotropite de boierii Buzești, cu care se judecase de mai multe ori.", "Slavonă", "Pergament", "Original", "Matei Basarab", "Matei Basarab", null, "Țara Românească", "3", "1654 (7162);martie 15");
RECORDS["_385"] = new MedievalDocuments("_385", 1654, "Popa Oană dă în stăpânirea jupânesei Tudorii a căpitanului Barbu Bădeanu pe Lupa țiganca, vândută pentru 30 ughi, pentru că o crescuse această jupâneasă.", "Română", "Hârtie", "Original", "Matei Basarab", "Popa Oană", null, "Țara Românească", "3", "1654 (7162);martie 17");
RECORDS["_386"] = new MedievalDocuments("_386", 1654, "Pârvul căpitan, Dumitru din Izvor și Radul din Ilfov și alți boieri megiași luați de mitropolit să cerceteze unde i-a apucat Legătura lui Mihai Vodă pe Nicola și Duca cu frații lor, adeveresc că aceștia sunt din Broscari, „unde s-au născut, au crescut și au șezut\" și nu din satul Gogoși.", "Română", "Hârtie", "Original", "Matei Basarab", "Pârvul căpitan, Dumitru din Izvor și Radul din Ilfov și alți boieri megiași", null, "Țara Românească", "3", "1654 (7162);martie 20");
RECORDS["_387"] = new MedievalDocuments("_387", 1654, "Doisprezece megiași jură că i-au dovedit pe Nicola și pe Duca și pe frații acestora ca născuți, crescuți și că au locuit tot în Broscari. ", null, null, "Rezumat", "Matei Basarab", "Doisprezece megiași", null, "Țara Românească", "3", "1654 (7162);martie 20");
RECORDS["_388"] = new MedievalDocuments("_388", 1654, "Egumenul mănăstirii Govora, Dionisie, vinde părintelui Teodor de la mănăstirea Topolnița moșia de la Curiacea, <j. Mehedinți>, pentru 100 de oi și 50 de taleri. ", "Română", "Hârtie", "Original", "Matei Basarab", "Egumenul mănăstirii Govora, Dionisie", null, "Țara Românească", "3", "1654 (7162);martie 25");
RECORDS["_389"] = new MedievalDocuments("_389", 1654, "Avram și Radu, cu nepotul său, Radu din Morânglavi vând paharnicului Pătrașco și fratelui acestuia, Giura, partea lor de moșie din Ciorecești, <j. Romanați>, din funia ciumăgească, cu 1200 bani.", "Română", "Hârtie", "Original", "Matei Basarab", "Avram și Radu, cu nepotul său, Radu din Morânglavi", null, "Țara Românească", "3", "1654 (7162);martie 27");
RECORDS["_390"] = new MedievalDocuments("_390", 1654, "Goran, fiul lui Andrei din Băbeni, vinde lui Tănasie paharnic din Sărăcinești 2 funii de moșie în Mihăiești, <j. Vâlcea>, pentru 14 ughi.", "Română", "Hârtie", "Original", "Matei Basarab", "Goran, fiul lui Andrei din Băbeni", null, "Țara Românească", "3", "1654 (7162);martie 27");
RECORDS["_391"] = new MedievalDocuments("_391", 1654, "Proda călăraș vinde lui Radu al doilea portar ocină la Gănești, <j. Ilfov>.", "Română", null, "Copie", "Matei Basarab", "Proda călăraș", null, "Țara Românească", "3", "1654 (7162);martie 28");
RECORDS["_392"] = new MedievalDocuments("_392", 1654, "Stanciu, Vlad și Oancea din Bughea vând muntele Piscul Râului lui Coman din Rucăr <j. Argeș>.", null, null, null, "Matei Basarab", "Stanciul, Vlad și Oancea din Bughea", null, "Țara Românească", "3", "1654 (7162);martie 28");
RECORDS["_393"] = new MedievalDocuments("_393", 1654, "Matei Basarab voievod întărește schimbul de moșii Ia Băicoi, j. Prahova și Ia Brebu, între mănăstirea Brebul, j. Prahova și Stan, fiul lui Ioan din Brebul.", "Română", null, "Copie", "Matei Basarab", "Matei Basarab", "5176", "Țara Românească", "3", "1654 (7162);martie 29");
RECORDS["_394"] = new MedievalDocuments("_394", 1654, "Andrei și Petriman, fiii lui Vladul al lui Bobe, vând popii Gherghe din Săcuiani <j. Buzău>, curătura lor Ia Vadul lui Bădici, pentru 240 de bani.", "Română", "Hârtie", "Original", "Matei Basarab", "Andrei și Petriman, fiii lui Vladul al lui Bobe", null, "Țara Românească", "3", "1654 (7162);martie 30");
RECORDS["_395"] = new MedievalDocuments("_395", 1654, "Constantin Cantacuzino fost mare postelnic poruncește globnicilor să nu bântuiască niște țigănci de la Episcopia Buzău, pentru că a făcut schimb cu Radu Mihalcea Cândescu mare comis.", "Română", null, "Original", "Matei Basarab", "Constantin Cantacuzino fost mare postelnic", null, "Țara Românească", "3", "1654 (7162);martie 31");
RECORDS["_396"] = new MedievalDocuments("_396", 1654, "Papa paharnic dăruiește lui Leca iuzbașa moșie la Cepturile, j. Buzău.", "Română", "Hârtie", "Original", "Matei Basarab", "Papa paharnic", null, "Țara Românească", "3", "1654 (7162);martie 31");
RECORDS["_397"] = new MedievalDocuments("_397", 1654, "Stoian din Țigănești vinde finului său Vlad, o siliște de lângă Matca lui Nan.", "Română", "Hârtie", "Original", "Matei Basarab", "Stoian din Țigănești", null, "Țara Românească", "3", "1654 (7162);aprilie 1");
RECORDS["_398"] = new MedievalDocuments("_398", 1654, "Ignatie, mitropolitul Țării Românești, adeverește egumenului Dionisie de la Mănăstirea Valea o țigancă mănăstirii Valea și alta Mitropoliei, după ce egumenul precedent de la mănăstirea Valea le-a adus cu multă cheltuială din Ardeal.", "Română", "Hârtie", "Original", "Matei Basarab", "Ignatie, mitropolitul Țării Românești", null, "Țara Românească", "3", "1654 (7162);aprilie 1");
RECORDS["_399"] = new MedievalDocuments("_399", 1654, "Ignatie, mitropolitul Țării Românești, îngăduie fraților Stan și Datco din satul Sârbi, j. Dâmbovița, să se răscumpere din rumânie de către Mitropolie, dând în schimb, cap pentru cap, alți rumâni : Stan, cu cei trei fii ai lui, Vladul, Grozav și Ioan.", "Română", "Hârtie", "Original", "Matei Basarab", "Ignatie, mitropolitul Țării Românești", "5176", "Țara Românească", "3", "1654 (7162);aprilie 1");
RECORDS["_400"] = new MedievalDocuments("_400", 1654, "Matei Basarab voievod întărește mănăstirii Mărgineni un vad de moară și cu locul dimprejur, în orașul Târgoviște, pe apa Ialomiței. ", "Slavonă", "Hârtie", "Original", "Matei Basarab", "Matei Basarab", "5176", "Țara Românească", "3", "1654 (7162);aprilie 1");
RECORDS["_401"] = new MedievalDocuments("_401", 1654, "Duțe vinde vărului lui Tudoran ceauș ocină Ia Olteni, j. Râmnicul Sărat, pentru 700 de bani.", "Română", "Hârtie", "Original", "Matei Basarab", "Duțe", null, "Țara Românească", "3", "1654 (7162);aprilie 2");
RECORDS["_402"] = new MedievalDocuments("_402", 1654, "Matei Basarab voievod poruncește lui Spahiul, mare ban al Craiovei să judece cu dreptate pricina dintre Semen logofăt, fiul lui Necula pârcălab și sătenii din Gârbovi și Gheorghe paharnic din Serdănești, care au încălcat moșia părintească a lui Semen de la Gârbovi.", "Română", "Hârtie", "Original", "Matei Basarab", "Matei Basarab", null, "Țara Românească", "3", "1654 (7162);aprilie 3");
RECORDS["_403"] = new MedievalDocuments("_403", 1654, "Radu Popescu-Șintescu mare paharnic judecă pricina dintre Neagoe clucer și sătenii din Pâcleni, nemulțumiți că unii dintre ei împrumutaseră bani de la Neagoe clucer, dându-i în schimb ocină în sat.", "Română", "Hârtie", "Original", "Matei Basarab", "Radu Popescu-Șintescu mare paharnic", null, "Țara Românească", "3", "1654 (7162);aprilie 4");
RECORDS["_404"] = new MedievalDocuments("_404", 1654, "Tudor și Tecșan din Mătăsarul, Dumitru și frații lui din Boureni și alții se împacă cu Ianea căpitan, după litigiul care l-au avut pentru niște pământuri din Piatra Curmezișată din drumul Piteștilor.", "Română", "Hârtie", "Original", "Matei Basarab", "Tudor și Tecșan din Mătăsarul, Dumitru și frații lui din Boureni și alții", null, "Țara Românească", "3", "1654 (7162);aprilie 5");
RECORDS["_405"] = new MedievalDocuments("_405", 1654, "Gavrilă și Drăgoicea cumpără două pogoane de loc la Ghergănel, de la Dobromir, fiul lui Tudoran armaș, cu 2 lei. ", "Română", "Hârtie", "Original", "Matei Basarab", "Gavrilă și Drăgoicea", null, "Țara Românească", "3", "1654 (7162);aprilie 7");
RECORDS["_406"] = new MedievalDocuments("_406", 1654, "Nedelco vinde lui Dragomir Rodescu moșie în Cioroiași cu 8 ughi.", "Română", "Hârtie", "Original", "Matei Basarab", "Nedelco", null, "Țara Românească", "3", "1654 (7162);aprilie 7");
RECORDS["_407"] = new MedievalDocuments("_407", 1654, "Doisprezece boieri luați de egumenul Daniil al mănăstirii Dedulești și de fiii lui Ianoș ungurul pentru moșia de la Bădicești adeveresc că cei doi s-au învoit să facă schimb: egumenul Daniil să țină moșia de la Bădicești cu vadurile de moară de sus și de jos, iar fiii lui Ianoș să țină moșia de la Munteni cu vadurile de moară.", "Română", null, "Copie", "Constantin Șerban", "Doisprezece boieri", null, "Țara Românească", "3", "1654 (7162);<aprilie 9 - august 31>");
RECORDS["_408"] = new MedievalDocuments("_408", 1654, "Jupâneasa Ilinca, fiica lui lui Nicolae Pătrașco voievod și nepoata lui Mihai Viteazul, adeverește megieșilor din Glaveș și Carcadulea că îi lasă să stăpânească părțile din cele două moșii care îi fuseseră restituite de către voievodul Matei Basarab, iar jumătate din celelalte sate să fie stăpânite mai departe de către mănăstirea Mărgineni unde jupâneasa Ilinca le dăruise.", "Română", null, "Copie", "Constantin Șerban", "Jupâneasa Ilinca, fiica lui lui Nicolae Pătrașco voievod și nepoata lui Mihai Viteazul", null, "Țara Românească", "3", "1654 (7162);<aprilie 9 - august 31>");
RECORDS["_409"] = new MedievalDocuments("_409", 1654, "Ionașco postelnic din Cătun, fiul lui Miroslav logofăt vinde lui Iorgachi vornic pe Vintilă țiganul și pe fiica acestuia, Slavna, pentru 30 de galbeni.", "Română", "Hârtie", "Original", "Constantin Șerban", "Ionașco postelnic din Cătun, fiul lui Miroslav logofăt", null, "Țara Românească", "3", "1654 (7162);<aprilie 9 - august 31>");
RECORDS["_410"] = new MedievalDocuments("_410", 1654, "Listă a rumânilor lui Fera Racotă din Răzmirești care s-au răscumpărat, numai capetele, fără moșie.", "Română", "Hârtie", "Original", "Constantin Șerban", null, null, "Țara Românească", "3", "1654 (7162);<aprilie 9 - august 31>");
RECORDS["_411"] = new MedievalDocuments("_411", 1654, "Constantin Șerban voievod întărește jupânului Bunea vistier stăpânire peste moșia de la Dușești, j. Teleorman, împreună cu rumânii care i s-au vândut succesiv cu părțile lor de ocină, precum și livezile și cânepiștile.", null, null, null, "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);<aprilie 9 - august 31 >");
RECORDS["_412"] = new MedievalDocuments("_412", 1654, "Constantin Șerban voievod întărește lui Stanciu al preotesei din Râmnic să țină moșia Ulita de pe râul Râmnic, pentru că a plătit-o de bir în vremea lui Matei Basarab.", null, null, null, "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);<aprilie 9 - august 31>");
RECORDS["_413"] = new MedievalDocuments("_413", 1654, "Constantin Șerban voievod poruncește cămărașilor de la ocna Telega să nu mai trimită ciocănașii mănăstirii Mărgineni la ocna de la Râmnic, iar pe ceilalți rumâni ai mănăstirii să-i lase în pace.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);<aprilie 9 - august 31>");
RECORDS["_414"] = new MedievalDocuments("_414", 1654, "Constantin Șerban voievod întărește lui Apostol și fratelui său Ghinea vii la Pitești și niște țigănci și rumâni partea mamei, iar fratele lor Leca să nu aibă amestec.", null, null, "Rezumat", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);<post aprilie 9 - august 31>");
RECORDS["_415"] = new MedievalDocuments("_415", 1654, "Constantin Șerban voievod întărește moșnenilor din <Clinceni, Măicănești, Flocești> să-și ia fiecare partea de moșie, după cum au deținut înainte.", "Greacă", null, "Rezumat", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);<post aprilie 9 - august 31>");
