RECORDS["_420"] = new MedievalDocuments("_420", 1654, "Negoiță spătar, fiul lui Ivan pitar din Văcărești întărește 8 țigani de zestre surorii sale, Alexandra și cumnatului său, Mihai.", "Română", "Hârtie", "Original", "Matei Basarab", "Negoiță spătar, fiul lui Ivan pitar din Văcărești", null, "Țara Românească", "3", "1654 (7162);aprilie 12");
RECORDS["_421"] = new MedievalDocuments("_421", 1654, "Floarea, fata lui Vasile, nepotul lui Toader din Gârbovăț, vinde unchiului ei, Bălaci, partea ei de moșie din sat.", null, null, "Rezumat", "Matei Basarab", "Floarea, fata lui Vasile, nepotul lui Toader din Gârbovăț", null, "Țara Românească", "3", "1654 (7162);aprilie 15");
