RECORDS["_425"] = new MedievalDocuments("_425", 1654, "Constantin Șerban voievod întărește lui Buliga, fost mare agă de dorobanți, dreptul de stăpânire asupra satului Seaca Carava, j. Mehedinți, cu rumânii, pentru dreaptă și credincioasă slujbă făcută domniei și țării.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "5176", "Țara Românească", "3", "1654 (7162);aprilie 25");
RECORDS["_426"] = new MedievalDocuments("_426", 1654, "Constantin Șerban voievod întărește iertarea din rumânie a satului Corbi, j. Vlașca, făcută pe patul de moarte de fiul adoptiv al domnului Matei Basarab, Mateiaș postelnic Năsturel.", "Slavonă", null, "Copie", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);aprilie 25");
RECORDS["_427"] = new MedievalDocuments("_427", 1654, "Constantin Șerban voievod întărește lui Stănilă postelnic din Vâlcănești, j. Dolj și vărului său, Radul postelnic și nepotului său, Mihai, fiul lui Drosul postelnic, dreptul de stăpânire asupra satului Salcia de la Motru, j. Mehedinți, cu toți rumânii și cu țigănia.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);aprilie 25");
