RECORDS["_736"] = new MedievalDocuments("_736", 1654, "Cei șase boieri jurători ai lui Oprea iuzbașa mărturisesc pentru pricina ce a avut cu Căzan postelnic, pentru dreptul de protimis la cumpărarea moșiei de la Teșila.", "Română", "Hârtie", "Original", "Constantin Șerban", "Șase boieri jurători", null, "Țara Românească", "3", "1654 (7163);septembrie 16");
RECORDS["_737"] = new MedievalDocuments("_737", 1654, "Constantin Șerban voievod întărește lui Diicu <Buicescu> fost mare spătar dreptul de a stăpâni jumătate din satul Arcești, j. Romanați.", "Slavonă", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "4345", "Țara Românească", "3", "1654 (7163);septembrie 17");
RECORDS["_738"] = new MedievalDocuments("_738", 1654, "Constantin Șerban voievod întărește lui Dragomir căpitan din Călugăreni, j. Sac, stăpânirea pe ocinile cumpărate din Glaveș și Carcadulea.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7163);septembrie 17");
RECORDS["_739"] = new MedievalDocuments("_739", 1654, "Ignatie mitropolit al Ungrovlahiei, Pană Filipescu mare paharnic și Radul Mihalcea Cândescu mare comis poruncesc celor șase boieri luați de Serafim episcopul Buzăului să aleagă partea de moșie a Episcopiei în satul Pizdulești <j. Sac>.", "Română", "Hârtie", "Original", "Constantin Șerban", "Ignatie mitropolit al Ungrovlahiei, Pană Filipescu mare paharnic și Radul Mihalcea Cândescu mare comis", null, "Țara Românească", "3", "1654 (7163);septembrie 18");
RECORDS["_740"] = new MedievalDocuments("_740", 1654, "Șase boieri luați de Pătrașco căpitan din Tomeni aleg hotarele părților lui Badea vătaf de aprozi, Pătrașco căpitan din Tomeni și Stanciul postelnic din Vârâți, în satele Grădiștea și Vârâți.", "Română", "Hârtie", "Original", "Constantin Șerban", "Șase boieri", null, "Țara Românească", "3", "1654 (7163);septembrie 20");
