RECORDS["_743"] = new MedievalDocuments("_743", 1654, "Constantin Șerban voievod dă lui Tudoran ceauș din Buzău, dreptul de a lua dijmă de pe moșia Târcovu <j. Buzău>.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7163);septembrie 27");
RECORDS["_744"] = new MedievalDocuments("_744", 1654, "Constantin Șerban voievod întărește mănăstirii Brâncoveni și egumenului Gavril stăpânirea pe moșiile de danie din Robănești și Balș, j. Romanați.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7163);septembrie 30");
RECORDS["_745"] = new MedievalDocuments("_745", 1654, "Constantin Șerban voievod poruncește celor 24 de boieri hotarnici luați de jupâneasa Hârșova ca să verifice hotărnicia satelor Caraula, Întorsătura Bubii și Cucuiați, <j. Mehedinți>, făcută în vremea domniei lui Matei Basarab și contestată de Giurca din Cucuiați.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7163);octombrie 2");
RECORDS["_746"] = new MedievalDocuments("_746", 1654, "Douăzeci și patru de boieri luați pe răvașe domnești de Serafim, episcopul Buzăului, Moise Mihalcea Cândescu Mihălcescu spătar și de alți boieri, adeveresc hotărnicia moșiei Albești Chirăiți, <j. Buzău>.", "Română", "Hârtie", "Original", "Constantin Șerban", "Douăzeci și patru de boieri", null, "Țara Românească", "3", "1654 (7163);octombrie 3");
RECORDS["_747"] = new MedievalDocuments("_747", 1654, "Douăzeci și patru de boieri hotarnici luați pe răvașe domnești de Serafim, episcopul Buzăului, Moise Mihalcea Cândescu Mihălcescu spătar și Mihăilă Buhuci aleg toate moșiile de Ia Albești <j. Buzău> și adeveresc că Gheorghie iuzbașa n-a avut treabă să vândă moșia lui Mihăilă Buhuci.", "Română", "Hârtie", "Original", "Constantin Șerban", "Douăzeci și patru de boieri hotarnici", null, "Țara Românească", "3", "1654 (7163);octombrie 3");
