RECORDS["_749"] = new MedievalDocuments("_749", 1654, "Constantin Șerban voievod întărește mănăstirii Sfânta Troiță (Radu Vodă) vinăriciul de pe moșia mănăstirii, de la Văleni <j. Argeș>.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7163);octombrie 5");
RECORDS["_750"] = new MedievalDocuments("_750", 1654, "Șase jurători luați pe răvașe domnești de Coman armaș din Broșteni <j. Ialomița>, adeveresc în pricina dintre acesta și nepotul său, Drăgan.", "Română", "Hârtie", "Original", "Constantin Șerban", "Șase jurători", null, "Țara Românească", "3", "1654 (7163);octombrie 10");
RECORDS["_751"] = new MedievalDocuments("_751", 1654, "Unchiașul Coman Enășescul din Dragoslavele, împreună cu feciorii lui, mărturisesc egumenului Varlaam de la Câmpulung, că au vândut domnului Matei Basarab satul Bădeni, <j. Mușcel>, acesta dăruindu-l mănăstirii. Susținând în divanul lui Constantin Șerban voievod că satul le fusese luat cu sila, Coman Enășescul și fiii săi au rămas de lege în fața egumenului Varlaam.", "Română", "Hârtie", "Original", "Constantin Șerban", "Unchiașul Coman Enășescul din Dragoslavele, împreună cu feciorii lui", null, "Țara Românească", "3", "1654 (7163);octombrie 11");
RECORDS["_752"] = new MedievalDocuments("_752", 1654, "Varvara, jupâneasa lui Socot Cornățeanu clucer, cu fiii săi, și Anca, jupâneasa lui Ianache Cornățeanu sluger, cu fiul său, vând vornicului Colțea din Doicești moșia lor de la Pârliți, j. Ialomița, fără rumâni.", "Română", null, "Copie", "Constantin Șerban", "Varvara, jupâneasa lui Socot Cornățeanu clucer, cu fiii săi, și Anca, jupâneasa lui Ianache Cornățeanu sluger, cu fiul său", null, "Țara Românească", "3", "1654 (7163);octombrie 11");
RECORDS["_753"] = new MedievalDocuments("_753", 1654, "Doisprezece boieri luați pe răvașe domnești de satul Scurtești, <j. Buzău>, și de Moise Mihalcea Cândescu Mihălcescu spătar jură înaintea episcopului de Buzău, Serafim, pentru moșiile din sat.", "Română", "Hârtie", "Original", "Constantin Șerban", "Doisprezece boieri", null, "Țara Românească", "3", "1654 (7163);octombrie 12");
RECORDS["_754"] = new MedievalDocuments("_754", 1654, "Iane, fiul lui Marco din Curte <j. Gorj>, vinde lui Radu, fiul lui Lazăr din Târgu Jiu, două delnițe în sat, cu 2000 aspri.", "Română", "Hârtie", "Original", "Constantin Șerban", "Iane, fiul lui Marco din Curte", null, "Țara Românească", "3", "1654 (7163);octombrie 13");
RECORDS["_755"] = new MedievalDocuments("_755", 1654, "Iane, fiul lui Marco din Curte, <j. Gorj>, confirmă lui Radu, fiul lui Lazăr <din Târgu Jiu>, primirea sumei de 7 ughi, pentru vânzarea celor două delnițe din sat.", "Română", "Hârtie", "Original", "Constantin Șerban", "Iane, fiul lui Marco din Curte", null, "Țara Românească", "3", "1654 (7163);octombrie 13");
RECORDS["_756"] = new MedievalDocuments("_756", 1654, "Trei boieri judecători aleg moșia Sulari, j. Dolj, cotropită de Barbu Poenaru stolnic, adeverind mănăstirii Coșuna a patra parte, rumânilor lui Barbu Poenaru stolnic 919 stânjeni și judecilor din sat părțile rămase.", "Română", null, "Copie", "Constantin Șerban", "Trei boieri judecători", null, "Țara Românească", "3", "1654 (7163);octombrie 13");
RECORDS["_757"] = new MedievalDocuments("_757", 1654, "Satul Lazul, j. Dolj, adeverește că a împrumutat bani de la Pană Pârdescu cămăraș pentru a se răscumpăra de rumânie de la Istratie Leurdeanu mare postelnic.", "Română", "Hârtie", "Original", "Constantin Șerban", "Satul Lazul", null, "Țara Românească", "3", "1654 (7163);octombrie 14");
RECORDS["_758"] = new MedievalDocuments("_758", 1654, "Ana, sora lui Lupul căpitan, vinde lui Damian iuzbașa trei ciozvârte de țelină <la Vernești, j. Buzău>, cu 520 bani gata.", "Română", "Hârtie", "Original", "Constantin Șerban", "Ana, sora lui Lupul căpitan", null, "Țara Românească", "3", "1654 (7163);octombrie 15");
