RECORDS["_762"] = new MedievalDocuments("_762", 1654, "Stanciu Băhărosul din Mărgăritești, <în Rusănești, j. Romanați>, adeverește că a primit de la ltovoe postelnic, Hamza logofăt și Stoican din Popânzălești 300 bani, rămași neplătiți de banul Spahiu, pentru jumătatea de funie pe care o cumpărase de la Stanciu.", "Română", "Hârtie", "Original", "Constantin Șerban", "Stanciu Băhărosul din Mărgăritești", null, "Țara Românească", "3", "1654 (7163);octombrie 22");
