RECORDS["_764"] = new MedievalDocuments("_764", 1654, "Constantin Șerban voievod poruncește celor 6 boieri judecători și tocmitori ai mănăstirii Glavaciogul să cerceteze cine stăpânește moșia Cernătești, <j. Sac>.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7163);octombrie 23");
