RECORDS["_766"] = new MedievalDocuments("_766", 1654, "Constantin Șerban voievod întărește lui Negoiță Mihalcea Cândescu Mihălcescu clucer și fiilor săi ocina căpotească, siliștea Burciulești și siliștea Stăiești, <j. Rm. Sărat>, în urma pricinii avute cu Dumitrașco al lui Damian și Nenița dascălul.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7163);octombrie 26");
