RECORDS["_769"] = new MedievalDocuments("_769", 1654, "Constantin Șerban voievod întărește lui Dumitru ceauș, fiul lui Șain, și lui Zaharia pitar, fiul Slamnei, dreptul de stăpânire asupra satului Sărsca, j. Dolj, în urma judecății în divanul de la Craiova, cu Preda, fiul lui Știomlega.", "Slavonă", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7163);octombrie 28");
RECORDS["_770"] = new MedievalDocuments("_770", 1654, "Serafim, episcop de Buzău, dă „carte de mărturiseală\" lui Moise Mihalcea Cândescu Mihălcescu spătar, pentru satul Scurtești, <j. Buzău>, în urma jurământului de la Episcopie.", "Română", "Hârtie", "Original", "Constantin Șerban", "Serafim, episcop de Buzău", null, "Țara Românească", "3", "1654 (7163);octombrie 29");
