RECORDS["_776"] = new MedievalDocuments("_776", 1654, "Douăzeci și patru de boieri luați pe răvașe domnești de Serafim, episcopul Buzăului, de Moise Mihalcea Cândescu Mihălcescu spătar, de Mihăilă Buhuci și de alții hotărnicesc moșia Albești, j. Buzău.", "Română", "Hârtie", "Original", "Constantin Șerban", "Douăzeci și patru de boieri", null, "Țara Românească", "3", "1654 (7163);noiembrie 2");
