RECORDS["_784"] = new MedievalDocuments("_784", 1654, "Constantin Șerban voievod iartă satul Bogdănești, j. Vâlcea, de bir și de alte dări, pentru a sluji mănăstirii Arnota.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7163);noiembrie 8");
