RECORDS["_4993"] = new MedievalDocuments("_4993", 1642, "Radu Șăldu din Budeni, împreună cu soția lui, Neacșa, vinde lui Gheorghie vistier ocină în Românești, j. Vlașca.", "Română", null, "Copie", "Matei Basarab", "Radu Șăldu din Budeni, împreună cu soția lui, Neacșa", "5176", "Țara Românească", "13", "1642 (7151);noiembrie 18");
RECORDS["_4994"] = new MedievalDocuments("_4994", 1642, "Udrea comis al doilea, fiul lui Hrizea fost mare vornic, vinde lui Radu mare comis satul Drajna, j. Săcuiani, și părți la Ogretin <j. Săcuiani> și Jivești <j. Buzău>, cu rumâni.", "Română", null, "Copie", "Matei Basarab", "Udrea comis al doilea, fiul lui Hrizea fost mare vornic", null, "Țara Românească", "13", "<1642> noiembrie 18");
RECORDS["_4995"] = new MedievalDocuments("_4995", 1642, "Mușica vinde fratelui ei, Leca, 40 de stânjeni de ocină din zestrea ei de la Păpeni <j. Ialomița>, cu 14 galbeni și o oaie, pentru care a primit 16 râmători.", "Română", null, "Copie", "Matei Basarab", "Mușica", null, "Țara Românească", "13", "1642 (7151);noiembrie 20");
RECORDS["_4996"] = new MedievalDocuments("_4996", 1642, "Mitropolitul Teofil dă carte de blestem celor douăzeci și patru de boieri hotarnici, popilor și tuturor celor care vor mărturisi în pricina dintre mănăstirea Bistrița și ginerii lui Mihăilă postelnicul pentru satele Potelul și Găvojdibrodul <j. Romanați>, pentru care s-au purtat certuri timp de 10 ani.", "Română", "Hârtie", "Original", "Matei Basarab", "Mitropolitul Teofil", null, "Țara Românească", "13", "1642 (7151);noiembrie 23");
RECORDS["_4997"] = new MedievalDocuments("_4997", 1642, "Matei Basarab voievod numește șase boieri pe răvașe domnești pentru hotărnicirea a 120 stânjeni din ocina Dărmănești <j. Prahova> și a unui vad de moară pe apa Prahovei.", "Română", "Hârtie", "Original", "Matei Basarab", "Matei Basarab", "5176", "Țara Românească", "13", "1642 (7151);noiembrie 23");
RECORDS["_4998"] = new MedievalDocuments("_4998", 1642, "Matei Basarab voievod întărește lui Drăgușin, mare armaș din Deleni, partea megiașilor din Căzănești, j. Olt, pe care-i rumânește fiindcă au fugit de bir și de dăjdii.", "Slavonă", "Pergament", "Original", "Matei Basarab", "Matei Basarab", "5176", "Țara Românească", "13", "1642 (7151);noiembrie 23");
RECORDS["_4999"] = new MedievalDocuments("_4999", 1642, "Douăzeci și patru de boieri luați pe răvașe domnești de egumenul Vasilie de la mănăstirea Bistrița și de ginerii lui Mihăilă postelnic hotărnicesc ocinele mănăstirii Bistrița din satul Potelul <j. Romanați>, mai mult dinspre ocina numită Iana-Poiana și balta Mamina.", "Română", "Hârtie", "Original", "Matei Basarab", "Douăzeci și patru de boieri", null, "Țara Românească", "13", "1642 (7151);noiembrie 26");
RECORDS["_5000"] = new MedievalDocuments("_5000", 1642, "Cartea boierilor hotarnici luați de mănăstirea Bistrița și de ginerii lui Mihăilă postelnicul să aleagă hotarul și bălțile mănăstirii de la Potelul de către satul Găvojdibrodul <j. Romanați> al acestor boieri.", "Română", "Hârtie", "Original", "Matei Basarab", "Douăzeci și patru de boieri", null, "Țara Românească", "13", "1642 (7151);noiembrie 27");
